content:
Create JavaScript files to upload as static resources and apply them to your Channel Menu website or Experience site. 

REQUIRED EDITIONS AND USER PERMISSIONS
Channel Menu setup node is available in: Lightning Experience, Performance, Professional, Unlimited, and Essentials Editions.

USER PERMISSIONS NEEDED
To create and edit static resources: Customize Application AND Author Apex

You can use JavaScript static resource files for the Channel Menu. To set up your code file use this example:

Specify _snapinsSnippetSettingsFile on the Global window object
window._snapinsSnippetSettingsFile = (function() {})();
Store settings on embedded_svc.menu.snippetSettingsFile to merge in Channel Menu
window._snapinsSnippetSettingsFile = (function() {
    console.log("Code settings file loaded");

    // Chat menu-item specific settings
    embedded_svc.menu.snippetSettingsFile = {
        TestChatChannel: {
            settings: {
                prepopulatedPrechatFields: {"Subject":"Login Issue"},
                smallCompanyLogoImgURL: "https://yourwebsite.here/company_logo.png"
            }
        }
    };
})?
